int binarysearch(int arr[] ,int n, int j){
    int start =0;
    int end= n-1;

    

    while(start<=end){
        int mid = start + (end-start/2);
        if(arr[mid]==j){
            return mid;

        }
        if(arr[mid]<j){
            start= mid+1;
        }
        else{
            end = mid-1;
        }

    }
    return -1;

}

